import React, { useEffect, useState } from "react";
import { Navigate, useNavigate } from "react-router-dom";
import axios from "axios";
import "../styles/StockManagerDashboard.css";

function StockManagerDashboard() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [unauthorized, setUnauthorized] = useState(false);
  const navigate = useNavigate();

  const user = JSON.parse(localStorage.getItem("user"));

  useEffect(() => {
    if (!user || user.role !== "responsable_stock") {
      setUnauthorized(true);
      setLoading(false);
      return;
    }

    const fetchProducts = async () => {
      try {
        const token = localStorage.getItem("token");
        const res = await axios.get("http://localhost:5000/api/products", {
          headers: { Authorization: `Bearer ${token}` },
        });

        console.log("Produits reÃ§us:", res.data);

        // âš¡ Adapter selon la structure
        setProducts(Array.isArray(res.data) ? res.data : res.data.data);
      } catch (err) {
        console.error("Erreur chargement produits", err);
      } finally {
        setLoading(false);
      }
    };

    fetchProducts();
  }, [user]);

  if (loading) return <p className="loading-text">Chargement...</p>;
  if (unauthorized) return <Navigate to="/unauthorized" />;

  const handleUpdateProfile = () => {
    if (!user || !user.id) {
      alert("Utilisateur non connectÃ© ou ID manquant");
      return;
    }
    navigate(`/update-user/${user.id}`);
  };

  const handleDeleteProduct = async (id) => {
    if (!id) {
      alert("ID produit manquant !");
      return;
    }
    try {
      const token = localStorage.getItem("token");
      await axios.delete(`http://localhost:5000/api/products/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setProducts(products.filter((p) => p._id !== id));
      alert("Produit supprimÃ© !");
    } catch (err) {
      console.error("Erreur suppression produit", err);
    }
  };

  return (
    <div className="dashboard-root">
      <div className="dashboard-container">
        <h1>ðŸ“¦ Gestion des Stocks ðŸ“¦</h1>

        <div className="dashboard-actions">
          <button onClick={() => navigate("/add-product")}>âž• Ajouter un produit</button>
          <button onClick={handleUpdateProfile}>ðŸ‘¤ Modifier mon profil</button>
          <button
            onClick={() => {
              localStorage.clear();
              window.location.href = "/";
            }}
          >
            ðŸšª DÃ©connexion
          </button>
        </div>

        <h2>Liste des produits</h2>
        <table className="product-table">
          <thead>
            <tr>
              <th>Nom</th>
              <th>Description</th>
              <th>QuantitÃ©</th>
              <th>Prix</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {Array.isArray(products) &&
              products.map((p) => (
                <tr key={p._id}>
                  <td>{p.name}</td>
                  <td>{p.description}</td>
                  <td>{p.quantity}</td>
                  <td>{p.price} â‚¬</td>
                  <td>
                    <button
                      className="del-btn"
                      onClick={() => handleDeleteProduct(p._id)}
                    >
                      ðŸ—‘ Supprimer
                    </button>
                  </td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default StockManagerDashboard;
